import Todo from "./Todo";

function Todolist ({todos})
{
    console.log(todos);
    return (

        <div className="todo-container">
            <ul className="todo-list">
                {todos.map((Todo)=>(
                    <Todo text={Todo.text} id={Todo.id}/>
                ))}
            </ul>
        </div>

    );


}
export default Todolist;
